import React from 'react';
import { Button as MuiButton } from '@mui/material';

const CustomButton = ({ children, variant, color, onClick, className }) => {
  return (
    <MuiButton 
      variant={variant} 
      color={color} 
      onClick={onClick} 
      className={className}
    >
      {children}
    </MuiButton>
  );
};

export default CustomButton;
